import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

import { MembersPage } from "./frontend-page/team-page/MembersPage";
import React from "react";
import { TeamPage } from "./frontend-page/team-page/TeamPage";

function App() {
  return (
    <Router>
        <Route path='/' component={TeamPage} />
        <Route path='/members' component={MembersPage} />
    </Router>
  );
}

export default App;
